import { useParams, Link } from "react-router-dom"
import DogsInfo from "./DogInfo";

const Dog = (props) => {
    const params = useParams();
    let info = {name:"",age:"", src:"", facts:[]}
    DogsInfo.forEach((inp)=>{
        console.log(inp);
        if(inp.name = params.name){
            info = inp
        }
    })
    console.log(info);
    
    return(
        <div>
            <Link to={"/"} className="nav">Home</Link>
            <div className="singleDog" style={{outline:"solid black 2px", margin:"auto", width:"30%"}}>
                <p className="name">{params.name}</p>
                <p className="age">{18}</p>
                <img src={props.img} alt="Dog" style={{width:"50%"}}/>
            </div>
        </div>
    )
}
export default Dog
